var myApp = angular.module('myApp', []);

myApp.directive('resize', function($window) {
  return {
    link: function(scope) {
      function onResize(e) {
        // Namespacing events with name of directive + event to avoid collisions
        scope.$broadcast('resize::resize');
      }

      function cleanUp() {
        angular.element($window).off('resize', onResize);
      }

      angular.element($window).on('resize', onResize);
      scope.$on('$destroy', cleanUp);
    }
  }
});

myApp.directive('alignheatmap', function() {
  return {
    restrict: 'E',
    template: '<div style="position:relative;"></div>',
    scope: {
      alignData: '=alignData',
      width: '=width',
      height: '=height'
    },
    link: function(scope, el, attrs) {
      var mySummary;
      var align_canvas = document.createElement('canvas');
      el.append(align_canvas);

      scope.$watch('alignData', function(newValue) {
        onDataChange();
      });

      scope.$on('resize::resize', function() {
        if (mySummary != null) {
          mySummary.resetHeight();
          mySummary.render('norm');
        }
      });

      // TODO: important.  What exactly do we need to cleanup in a directive to avoid
      //       a memory leak?  I.e
      //    scope.$on('$destroy', () => {
      //      $element[0].removeEventListener('dragleave', fileDragleave)
      //      $element[0].removeEventListener('dragover', fileDragover)
      //      $element[0].removeEventListener('drop', fileDrop)
      //    })

      function onDataChange() {
        if (scope.alignData != null && scope.alignData.alignments != null &&
          scope.alignData.alignments.length > 0) {
          if ( mySummary != null ) {
            mySummary.setData(scope.alignData);
          }else {
            mySummary = new AlignmentSummaryViewer(align_canvas, scope.alignData, {});
          }
        }
      }

    }
  }
});
